import React from "react";
import "./CardsComp.css";


function CardsComp() {
  return (
    <div className="card">
      <div className="image">
        <img
          src="https://i.pinimg.com/564x/4d/69/3b/4d693b33df231e590c8c374f9e5c0f7e.jpg"
          width="100%"
          height="200" 
          margin="20px auto"
         
          alt="" 
        />
      </div>
    </div>
  );
}

export default CardsComp;
